import React from 'react';
import { Modal } from "antd";

class ModelCheckout extends React.Component {
    state = { visible: false };
    handleOk = (e) => {
        this.setState({
          visible: false
        });
    };

    handleCancel = (e) => {
        console.log(e);
        this.setState({
            visible: false
        });
    };

    render() {
        return (
            <Modal
          width={650}
          title="Please Type Information"
          visible={this.state.visible}
          onOk={this.handleOk}
          onCancel={this.handleCancel}
        >
        </Modal>
        )
    }
}
export default ModelCheckout;
